  "prompt.template": "{{prompt_text}}",
  "prompt.variables": "{\n  \"prompt_text\": \"system: \\nYou are an AI assistant that helps users answer questions given a specific context and conversation history. You will be given a context and chat history, and then asked a question based on that context and history. Your answer should be as precise as possible, and should only come from the context.\\nPlease add citation after each sentence when possible in a form \\\"(Source: citation)\\\".\\n\\n user: \\n Content: # Monitoring Azure Machine Learning data reference\\n\\n| AmlDatasetName | The name of the Azure Machine Learning Data Set. |\\n\\n### AmlDataStoreEvent table\\n\\n| Property | Description |\\n|:--- |:--- |\\n| Type | Name of the log event, AmlDataStoreEvent |\\n| TimeGenerated | Time (UTC) when the log entry was generated |\\n| Level | The severity level of the event. Must be one of Informational, Warning, Error, or Critical. |\\n| ResultType | The status of the event. Typical values include Started, In Progress, Succeeded, Failed, Active, and Resolved. |\\n| AmlWorkspaceId | A GUID and unique ID of the Azure Machine Learning workspace. |\\n| OperationName | The name of the operation associated with the log entry |\\n| Identity | The identity of the user or application that performed the operation. |\\n| AadTenantId | The Microsoft Entra tenant ID the operation was submitted for. |\\n| AmlDatastoreName | The name of the Azure Machine Learning Data Store. |\\n\\n### AmlDeploymentEvent table\\n\\n| Property | Description |\\n|:--- |:--- |\\n| Type | Name of the log event, AmlDeploymentEvent |\\n| TimeGenerated | Time (UTC) when the log entry was generated |\\n| Level | The severity level of the event. Must be one of Informational, Warning, Error, or Critical. |\\n| ResultType | The status of the event. Typical values include Started, In Progress, Succeeded, Failed, Active, and Resolved. |\\n| OperationName | The name of the operation associated with the log entry |\\n| Identity | The identity of the user or application that performed the operation. |\\n| AadTenantId | The Microsoft Entra tenant ID the operation was submitted for. |\\n| AmlServiceName | The name of the Azure Machine Learning Service. |\\n\\n### AmlInferencingEvent table\\n\\n| Property | Description |\\n|:--- |:--- |\\n| Type | Name of the log event, AmlInferencingEvent |\\n| TimeGenerated | Time (UTC) when the log entry was generated |\\n| Level | The severity level of the event. Must be one of Informational, Warning, Error, or Critical. |\\n| ResultType | The status of the event. Typical values include Started, In Progress, Succeeded, Failed, Active, and Resolved. |\\n| OperationName | The name of the operation associated with the log entry |\\n| Identity | The identity of the user or application that performed the operation. |\\n| AadTenantId | The Microsoft Entra tenant ID the operation was submitted for. |\\n| AmlServiceName | The name of the Azure Machine Learning Service. |\\n\\n### AmlModelsEvent table\\n\\n| Property | Description |\\n|:--- |:--- |\\n| Type | Name of the log event, AmlModelsEvent |\\n| TimeGenerated | Time (UTC) when the log entry was generated |\\n| Level | The severity level of the event. Must be one of Informational, Warning, Error, or Critical. |\\n| ResultType | The status of the event. Typical values include Started, In Progress, Succeeded, Failed, Active, and Resolved. |\\n| OperationName | The name of the operation associated with the log entry |\\n| Identity | The identity of the user or application that performed the operation. |\\n| AadTenantId | The Microsoft Entra tenant ID the operation was submitted for. |\\n| ResultSignature | The HTTP status code of the event. Typical values include 200, 201, 202 etc. |\\n| AmlModelName | The name of the Azure Machine Learning Model. |\\n\\n### AmlPipelineEvent table\\n\\n| Property | Description |\\n|:--- |:--- |\\n| Type | Name of the log event, AmlPipelineEvent |\\n| TimeGenerated | Time (UTC) when the log entry was generated |\\n| Level | The severity level of the event. Must be one of Informational, Warning, Error, or Critical. |\\n| ResultType | The status of the event. Typical values include Started, In Progress, Succeeded, Failed, Active, and Resolved. |\\n| AmlWorkspaceId | A GUID and unique ID of the Azure Machine Learning workspace. |\\n| AmlWorkspaceId | The name of the Azure Machine Learning workspace. |\\nSource: monitor-resource-reference.md\\n\\nContent: # Tutorial: Create resources you need to get started\\n\\n---\\ntitle: \\\"Tutorial: Create workspace resources\\\"\\ntitleSuffix: Azure Machine Learning\\ndescription: Create an Azure Machine Learning workspace and cloud resources that can be used to train machine learning models.\\nservices: machine-learning\\nms.service: machine-learning\\nms.subservice: core\\nms.topic: tutorial\\nauthor: sdgilley\\nms.author: sgilley\\nms.reviewer: sgilley\\nms.date: 08/17/2023\\nadobe-target: true\\nms.custom: FY21Q4-aml-seo-hack, contperf-fy21q4, mode-other, ignite-2022\\n#Customer intent: As a data scientist, I want to create a workspace so that I can start to use Azure Machine Learning.\\n---\\n\\n# Tutorial: Create resources you need to get started\\n\\nIn this tutorial, you will create the resources you need to start working with Azure Machine Learning.\\n\\n> [!div class=\\\"checklist\\\"]\\n>* A *workspace*.  To use Azure Machine Learning, you'll first need a workspace.  The workspace is the central place to view and manage all the artifacts and resources you create. \\n>* A *compute instance*.  A compute instance is a pre-configured cloud-computing resource that you can use to train, automate, manage, and track machine learning models. A compute instance is the quickest way to start using the Azure Machine Learning SDKs and CLIs. You'll use it to run Jupyter notebooks and Python scripts in the rest of the tutorials.\\n\\nThis video shows you how to create a workspace and compute instance.  The steps are also described in the sections below.\\n> [!VIDEO https://learn-video.azurefd.net/vod/player?id=a0e901d2-e82a-4e96-9c7f-3b5467859969]\\n\\n## Prerequisites\\n\\n- An Azure account with an active subscription. [Create an account for free](https://azure.microsoft.com/free/machine-learning).\\n\\n## Create the workspace\\n\\nThe workspace is the top-level resource for your machine learning activities, providing a centralized place to view and manage the artifacts you create when you use Azure Machine Learning.\\n\\nIf you  already have a workspace, skip this section and continue to [Create a compute instance](#create-a-compute-instance).\\n\\nIf you don't yet have a workspace, create one now: \\n\\n1. Sign in to [Azure Machine Learning studio](https://ml.azure.com)\\n1. Select **Create workspace**\\n1. Provide the following information to configure your new workspace:\\n\\n   Field|Description \\n   ---|---\\n   Workspace name |Enter a unique name that identifies your workspace. Names must be unique across the resource group. Use a name that's easy to recall and to differentiate from workspaces created by others. The workspace name is case-insensitive.\\n   Subscription |Select the Azure subscription that you want to use.\\n   Resource group | Use an existing resource group in your subscription or enter a name to create a new resource group. A resource group holds related resources for an Azure solution. You need *contributor* or *owner* role to use an existing resource group.  For more information about access, see [Manage access to an Azure Machine Learning workspace](how-to-assign-roles.md).\\n   Region | Select the Azure region closest to your users and the data resources to create your workspace.\\n1. Select **Create** to create the workspace\\n\\n> [!NOTE]\\n> This creates a workspace along with all required resources. If you would like to reuse resources, such as Storage Account, Azure Container Registry, Azure KeyVault, or Application Insights, use the [Azure portal](https://ms.portal.azure.com/#create/Microsoft.MachineLearningServices) instead.\\n\\n## Create a compute instance\\n\\nYou'll use the *compute instance* to run Jupyter notebooks and Python scripts in the rest of the tutorials. If you don't yet have a compute instance, create one now:\\n\\n1. On the left navigation, select **Notebooks**.\\n1. Select **Create compute** in the middle of the page. \\n\\n    :::image type=\\\"content\\\" source=\\\"media/quickstart-create-resources/create-compute.png\\\" alt-text=\\\"Screenshot shows create compute in the middle of the screen.\\\":::\\n\\n    > [!TIP]\\n    > You'll only see this option if you don't yet have a compute instance in your workspace.\\nSource: quickstart-create-resources.md\\n\\nContent: # Frequently asked questions about forecasting in AutoML\\n\\n---\\ntitle: Frequently asked questions about forecasting in AutoML \\ntitleSuffix: Azure Machine Learning\\ndescription: Read answers to frequently asked questions about forecasting in AutoML.\\nservices: machine-learning\\nauthor: samgos93\\nms.author: sagoswami\\nms.reviewer: ssalgado \\nms.service: machine-learning\\nms.subservice: automl\\nms.topic: faq\\nms.custom: contperf-fy21q1, automl, FY21Q4-aml-seo-hack, sdkv2, event-tier1-build-2022\\nms.date: 08/01/2023\\n---\\n\\n# Frequently asked questions about forecasting in AutoML\\n\\n[!INCLUDE [sdk v2](includes/machine-learning-sdk-v2.md)]\\n\\nThis article answers common questions about forecasting in automatic machine learning (AutoML). For general information about forecasting methodology in AutoML, see the [Overview of forecasting methods in AutoML](./concept-automl-forecasting-methods.md) article.\\n\\n## How do I start building forecasting models in AutoML?\\n\\nYou can start by reading the [Set up AutoML to train a time-series forecasting model](./how-to-auto-train-forecast.md) article. You can also find hands-on examples in several Jupyter notebooks:\\n  \\n- [Bike share example](https://github.com/Azure/azureml-examples/blob/main/sdk/python/jobs/automl-standalone-jobs/automl-forecasting-task-bike-share/auto-ml-forecasting-bike-share.ipynb)\\n- [Forecasting using deep learning](https://github.com/Azure/azureml-examples/blob/main/sdk/python/jobs/automl-standalone-jobs/automl-forecasting-github-dau/auto-ml-forecasting-github-dau.ipynb)\\n- [Many Models solution](https://github.com/Azure/azureml-examples/blob/v1-archive/v1/python-sdk/tutorials/automl-with-azureml/forecasting-many-models/auto-ml-forecasting-many-models.ipynb)\\n- [Forecasting recipes](https://github.com/Azure/azureml-examples/blob/v1-archive/v1/python-sdk/tutorials/automl-with-azureml/forecasting-recipes-univariate/auto-ml-forecasting-univariate-recipe-experiment-settings.ipynb)\\n- [Advanced forecasting scenarios](https://github.com/Azure/azureml-examples/blob/v1-archive/v1/python-sdk/tutorials/automl-with-azureml/forecasting-forecast-function/auto-ml-forecasting-function.ipynb)\\n\\n## Why is AutoML slow on my data?\\n\\nWe're always working to make AutoML faster and more scalable. To work as a general forecasting platform, AutoML does extensive data validations and complex feature engineering, and it searches over a large model space. This complexity can require a lot of time, depending on the data and the configuration.\\n\\nOne common source of slow runtime is training AutoML with default settings on data that contains numerous time series. The cost of many forecasting methods scales with the number of series. For example, methods like Exponential Smoothing and Prophet [train a model for each time series](./concept-automl-forecasting-methods.md#model-grouping) in the training data.\\n\\nThe Many Models feature of AutoML scales to these scenarios by distributing training jobs across a compute cluster. It has been successfully applied to data with millions of time series. For more information, see the [many models](concept-automl-forecasting-at-scale.md#many-models) article section. You can also read about [the success of Many Models](https://techcommunity.microsoft.com/t5/ai-machine-learning-blog/automated-machine-learning-on-the-m5-forecasting-competition/ba-p/2933391) on a high-profile competition dataset.\\n\\n## How can I make AutoML faster?\\n\\nSee the [Why is AutoML slow on my data?](#why-is-automl-slow-on-my-data) answer to understand why AutoML might be slow in your case.\\n\\nConsider the following configuration changes that might speed up your job:\\n\\n- [Block time series models](./how-to-auto-train-forecast.md#model-search-settings) like ARIMA and Prophet.\\n- Turn off look-back features like lags and rolling windows.\\n- Reduce:\\n  - The number of trials/iterations.\\n  - Trial/iteration timeout.\\n  - Experiment timeout.\\nSource: how-to-automl-forecasting-faq.md \\n\\n chat history: \\n user: \\nhow are you? \\nassistant: \\n \\nuser: do you know about aml \\nassistant:\"\n}"
